async supplierId => {
  const products = await getSupplierProducts.run({
    supplierId
  });
  return products.map(p => {
    return {
      Id: p.id,
      Name: p.name,
      Price: p.price,
      Description: p.description,
      Image: p.image,
      Sku: p.sku
    };
  });
}

async () => {
  const suppliers = await getSuppliers.run();
  return suppliers.map(s => {
    return {
      Id: s.id,
      Name: s.name,
      Email: s.email,
      Phone: s.phone,
      Address: s.address
    };
  });
}
